Projeto Grupo Avenida x Oi - O projeto foi contemplado na instalação de 3 access point por loja, para tal atividade sera necessária duas visitas: vistoria e instalação.                                                     VISTORIA - Assim que chegar no local, se identificar para a(o) gerente da loja, informando que vai tirar as medidas e verificar material necessário para a instalação. Nesse momento, já confirmar qual seria melhor horário para execução da atividade. As orientações serão passadas pelo Queiroz, ele fica na central do suporte da loja. Entrar em contato com ele através do numero 65 9252-6706. Ele possui as plantas já loja, informações técnicas da loja, enfim conhece todo o ambiente. Feito essa atividade, aguardamos o orçamento do material e mão de obra (devem ser enviados separadamente), os mesmos devem ser enviados através do e-mail projetos@eunerd.com.br. Assim enviaremos para aprovação, recebendo o de acordo do cliente, entramos em contato para agendar a segunda visita de instalação.

Lembrando:
•	Toda infraestrutura deverá seguir normativas de segurança conforme;
•	Deverão ser identificados os cabos dos AP's no rack;
•	Deverão realizar organização de cabos no rack, possibilitando possíveis manutenção;
•	Os agendamentos deverão ser de máximo 3 lojas dias;
•	Será solicitado, fotos para acompanhamento, por isso, tirar fotos antes das prestações de serviço a ser realizado;
•	Agendamento com 24hs de antecedência;
•	Toda manutenção será realizada fora do período de expediente da loja;
•	Levar equipamentos para possíveis intervenções (chaves fenda. philips, estilete, velcro, fita de nylon, etc);
•	Quaisquer dúvidas entrar em contato antes da intervenção;
•	Só será dado como concluído, quando as 3 pontas (Avenida, Oi e EuNerd ) se posicionarem;

